// pipes - inicio =====>
Vue.filter("capitalize", function(value) {
  if (!value) return "";
  value = value.toString();
  return value.charAt(0).toUpperCase() + value.slice(1);
});
Vue.filter("proper", function(value) {
  if (!value) return "";
  value = value.toString();
  return value
    .split(" ")
    .map((a) => a.substr(0, 1).toUpperCase() + a.substr(1).toLowerCase())
    .join(" ");
});
Vue.filter("semacentos", function(value) {
  if (!value) return "";
  value = value.toString();
  return value.normalize("NFD").replace(/[\u0300-\u036f]/g, "");
});
Vue.filter("datetime", function(value) {
  if (!value) return "";
  return (
    new Date(value).toLocaleDateString() +
    " " +
    new Date(value).toLocaleTimeString()
  );
});
Vue.filter("shortDate", function(value) {
  if (value) {
    // return moment(String(value)).format('DD/MM/YYYY')
    return value | moment("DD/MM/YYYY");
  }
});
Vue.filter("Time", function(value) {
  if (!value) return "";
  // return value.substr(5, 2) + '/' + value.substr(8, 2) + '/' + value.substr(0, 4) + ' ' + value.substr(11, 10)
  return new Date(value).toLocaleTimeString().substring(0, 5);
  /*
  if (value) {
    // return moment(String(value)).format('DD/MM/YYYY')
    if (typeof value == "number") {
      return new Date(value).toLocaleTimeString();
    } else {
      return String(value).toLocaleTimeString();
    }
  }
*/
});
Vue.filter("timeAgo", function(value) {
  if (value) {
    // return moment(String(value)).startOf().fromNow()
    return value | moment("from", "now", true);
  }
});
Vue.filter("charcode", function(value) {
  if (!value) return "";
  return String.fromCharCode(parseInt(value) + 64);
});
Vue.filter("bracked", function(value) {
  if (!value) return "";
  return "(" + value + ")";
});
Vue.filter("quoted", function(value) {
  if (!value) return "";
  return '"' + value + '"';
});
Vue.filter("dateBR", function(value) {
  if (!value) return "";
  // return value.substr(5, 2) + '/' + value.substr(8, 2) + '/' + value.substr(0, 4) + ' ' + value.substr(11, 10)
  return new Date(value).toLocaleDateString();
});
Vue.filter("dateBRHora", function(value) {
  if (!value) return "";
  // return value.substr(5, 2) + '/' + value.substr(8, 2) + '/' + value.substr(0, 4) + ' ' + value.substr(11, 10)
  return new Date(value).toLocaleString();
});
Vue.filter("dateDAY", function(value) {
  if (!value) return "";
  // return value.substr(5, 2) + '/' + value.substr(8, 2) + '/' + value.substr(0, 4) + ' ' + value.substr(11, 10)
  return new Date(value).getDate();
});
Vue.filter("week", function(value) {
  if (!value) return "";
  return new Date(value).getDay();
});
Vue.filter("weekname", function(value, week = new Date(value).getDay() || 0) {
  const wd = ["Dom", "Seg", "Ter", "Qua", "Qui", "Sex", "Sáb"];
  if (!value) return "";
  return wd[week];
});
Vue.filter("R$", function(value) {
  if (!value) return "";
  return value.toLocaleString("pt-br", { style: "currency", currency: "BRL" });
});
Vue.filter("ptBR", function(value) {
  if (!value) return "";
  return value.toLocaleString("pt-br");
});
Vue.filter("moeda", function(value) {
  if (!value) return "";
  if (parseFloat(value) == "NaN") return "";
  return parseFloat(value).toLocaleString("pt-br", {
    style: "currency",
    currency: "BRL",
  });
});
Vue.filter("percent", function(value, decimais = 2) {
  if (!value) return "";
  // return value.toLocaleString(undefined, { style: "percent", minimumFractionDigits: decimais || 2 });
  return parseFloat(value).toFixed(decimais) + "%";
});
Vue.filter("decimals", function(value, decimais = 2) {
  if (!value) return "";
  // return value.toLocaleString(undefined, { style: "percent", minimumFractionDigits: decimais || 2 });
  return parseFloat(value).toFixed(decimais);
});
Vue.filter("string", function(value) {
  if (!value) return "";
  return value.toString();
});
Vue.filter("LZero", function(value, len = 1) {
  if (!value) return "";
  return value.toString().padStart(len, "0");
});
Vue.filter("RZero", function(value, len = 1) {
  if (!value) return "";
  return value.toString().padEnd(len, "0");
});
Vue.filter("LSecret", function(value, chars = 4, mask = "*") {
  if (!value) return "";
  return value.toString().slice(chars*-1).padEnd(value.toString().length, mask);
});
Vue.filter("RSecret", function(value, chars = 4, mask = "*") {
  if (!value) return "";
  return value.toString().slice(chars*-1).padStart(value.toString().length, mask);
});
Vue.filter("jsonPretty", function(value) {
  let json = JSON.stringify(JSON.parse(value), null, 2);
  json = json
    .replace(/&/g, "&amp;")
    .replace(/</g, "&lt;")
    .replace(/>/g, "&gt;");
  return json.replace(
    /("(\\u[a-zA-Z0-9]{4}|\\[^u]|[^\\"])*"(\s*:)?|\b(true|false|null)\b|-?\d+(?:\.\d*)?(?:[eE][+]?\d+)?)/g,
    function(match) {
      var cls = "number";
      if (/^"/.test(match)) {
        if (/:$/.test(match)) {
          cls = "key";
        } else {
          cls = "string";
        }
      } else if (/true|false/.test(match)) {
        cls = "boolean";
      } else if (/null/.test(match)) {
        cls = "null";
      }
      return '<span class="' + cls + '">' + match + "</span>";
    }
  );
});
