Vue.directive("copy", {
  bind: (el, binding, vnode) => {
    //el.style.cursor = "pointer";
    el.style.cursor = "copy";
    el.title = "Clique para copiar";

    el.addEventListener("mouseenter", function( event ) {
      event.target.style.textDecoration = "underline";
    }, false);
    el.addEventListener("mouseleave", function( event ) {
      event.target.style.textDecoration = "inherit";
    }, false);

    el.addEventListener("click", (event) => {
      event.preventDefault();
      event.stopPropagation();
      // console.log('directive.copy: "' + el.innerHTML + '" copied!');
      navigator.clipboard.writeText(el.innerHTML.trim());
      vnode.context.$root.toastinfo("Copiado para área de transferência!");
      setTimeout(() => {
        vnode.context.$emit("v-copy-event", el.innerHTML);
      }, 1000);
    });
  },
  unbind: (el, binding) => {
    el.removeEventListener("click", () => {});
  },
});
Vue.directive("debounce", {
  // não funcionou ...
  bind: (el, binding) => {
    console.log("debounce:hit");
    if (binding.value !== binding.oldValue)
      el.oninput = setTimeout(() => {
        el.dispatchEvent(new Event("change"));
      }, 1000);
  },
});
Vue.directive("thdrag", {
  bind: (el, binding, vnode) => {
    console.log("binding.value", binding.value);
    el.draggable = true;
    el.addEventListener("dragstart", (e) => {
      e.target.parentNode.parentNode.setAttribute(
        // o parent é o TH e o parent do TH é o TR
        "dragstart",
        binding.value
      );
    });
    el.addEventListener("dragenter", (e) => {
      if (
        e.target.parentNode.parentNode.getAttribute("dragstart") !=
        binding.value
      ) {
        e.target.classList.add("thdrag-over");
      }
    });
    el.addEventListener("dragleave", (e) => {
      e.target.classList.remove("thdrag-over");
    });
    el.addEventListener("dragover", (e) => {
      e.preventDefault();
      if (
        e.target.parentNode.parentNode.getAttribute("dragstart") ==
        binding.value
      ) {
        e.target.classList.remove("thdrag-over");
      }
    });
    el.addEventListener("drop", (e) => {
      if (
        e.target.parentNode.parentNode.getAttribute("dragstart") !=
        binding.value
      ) {
        const move = [
          e.target.parentNode.parentNode.getAttribute("dragstart"),
          binding.value,
        ];

        console.log("move column", move[0], "to", move[1]);

        el.dispatchEvent(
          new CustomEvent("move", {
            bubbles: true,
            detail: move,
          })
        );

        // vnode.context.$root.$emit("move", { event: e, columns: move });
      }
      e.target.classList.remove("thdrag-over");
    });
    /* el.addEventListener("move", (e) => {
      console.log("move do main");
    }); */
  },
  unbind: (el) => {
    el.removeEventListener("dragstart", () => {});
    el.removeEventListener("dragenter", () => {});
    el.removeEventListener("dragover", () => {});
    el.removeEventListener("dragleave", () => {});
  },
});

