function setLocale(to, from, next) {
  if (to && from) {
    const hasLang = to.params && to.params.lang;
    const hadLang = from.params && from.params.lang;

    // If the language hasn't changed since last route we're done
    if (
      hasLang &&
      hadLang &&
      from.params.lang.toLowerCase() === to.params.lang.toLowerCase()
    ) {
      next();
    }

    // Get the save language if it exists
    // let lang = this.$cookies.get('language') ? localStorage.lang.toLowerCase() : 'pt';
    // let lang = document.cookies.get('language') ? localStorage.lang.toLowerCase() : 'pt';
    const navLang = navigator.browserLanguage || navigator.language;
    let lang = "en";

    if (navLang == "pt-BR") lang = "pt";
    if (navLang == "es-ES") lang = "es";
    if (navLang == "zh-CN") lang = "ch";

    // Se não for nenhuma linguagem válida força Inglês
    // if (!['en', 'pt', 'es', 'ch'].includes(lang)) {
    //   lang = 'en'
    // }

    // Overwrite the language with the route if there is one
    if (hasLang) {
      lang = to.params.lang.toLowerCase();
    }

    // Set the website language based on the URL
    i18n.locale = lang;
    localStorage.lang = lang;
    moment().locale(lang);

    // Redirect to a url with the language
    if (!hasLang) {
      return next(`/${lang}${to.fullPath}`);
    }
    return next();
  }
}

new Vue({
