      const d = h.getDay().toString().padStart(2, '0') + '/' + h.getMonth().toString().padStart(2, '0') + '/' + h.getFullYear().toString().padStart(4, '0');
      return d.toLocaleDateString();
    },
    goto(refName) {
      var element = this.$els[refName];
      element.scrollIntoView({ behavior: "smooth" });
    },

    toast(message, config) {
      const h = this.$createElement;
      const title = h("div", [
        h("b-icon-" + config.icon || "hdd-network", {
          style: "width: 16px; height: 16px",
        }),
        h("span", {
          style: "font-weight: bold; margin-left: 5px;",
          domProps: { innerHTML: config.title || "Intranet" },
        }),
      ]);

      if (!config) {
        config = {
          title: [title],
          autoHideDelay: 5000,
          appendToast: true,
          solid: true,
        };
      }

      if (typeof config == "object") {
        config.title = [title];
        (config.autoHideDelay = config.autoHideDelay || 5000),
          (config.appendToast = config.appendToast || true),
          (config.solid = config.solid || true);
      }

      this.$bvToast.toast(message, config);
    },

    toastsuccess(message) {
      this.toast(message, { variant: "success", icon: "hand-thumbs-up" });
    },

    toastdanger(message) {
